import React from 'react';
import Tribe from './assets/Tribe.png'

const Index = () => {
  return( 
    <>  
        <container className='container'>
            <img src={Tribe} alt='tribe' />
            <h1>Hello</h1>
        </container>
    </>
    )
};

export default Index;
